[{'comment_id': 1257497839, 'comment_body': '@Nabhag8848  It may be hard to maintain these if there are changes in notion itself.', 'comment_created': datetime.datetime(2023, 7, 9, 15, 0, 44, tzinfo=datetime.timezone.utc), 'commenter': 'samad-yar-khan', 'type': 'User'}, {'comment_id': 1257497986, 'comment_body': '@Nabhag8848 Can we make this more readable ?', 'comment_created': datetime.datetime(2023, 7, 9, 15, 1, 44, tzinfo=datetime.timezone.utc), 'commenter': 'samad-yar-khan', 'type': 'User'}, {'comment_id': 1257498625, 'comment_body': '@Nabhag8848  instead of adding these comments, we can just make these conditions as variables themselves. Comments get outdated with every change. Working code however is always the source of truth. 

```
noOtherStateAndEmptyValue = !value && inputElementState;
if(noOtherStateAndEmptyValue ){
 ....
}

nullStateAndCharEntered =  !inputElementState;
if (nullStateAndCharEntered ){
...
}
```

This will also make sure that your condition also goes as per the actual logic and not some random control flow guided by comments. ', 'comment_created': datetime.datetime(2023, 7, 9, 15, 6, 25, tzinfo=datetime.timezone.utc), 'commenter': 'samad-yar-khan', 'type': 'User'}, {'comment_id': 1257499018, 'comment_body': '@Nabhag8848  Same over here. Conditions can be more concretely stored in variables to improve code maintainability. 
```
if (x>1  && y <2){
...
} 

```
is harder to maintain than

```
conditionExplained = (x>1  && y <2)
if(conditionExplained ){
...
}
```', 'comment_created': datetime.datetime(2023, 7, 9, 15, 8, 55, tzinfo=datetime.timezone.utc), 'commenter': 'samad-yar-khan', 'type': 'User'}, {'comment_id': 1257797484, 'comment_body': "Yep, @samad-yar-khan  pretty hard. I just check out the changelog and there are changes to it on 3 different releases before. 
1. Between [April - May-2023](https://developers.notion.com/page/changelog#april-18---may-1-2023)
2. Between [Oct-Nov-2022](https://developers.notion.com/page/changelog#october-25---november-7-2022)
3. In [July 2021](https://developers.notion.com/page/changelog#july-26-2021) 

Notion doesn't provide an endpoint to retrieve the available format of Number, format/available value for Notion types having configuration.

Is there any other way we can improve this and make it more managable? i think in this case enum would be more managable as, if there are changes we just need to add the change in enum folder.
", 'comment_created': datetime.datetime(2023, 7, 10, 6, 52, 38, tzinfo=datetime.timezone.utc), 'commenter': 'Nabhag8848', 'type': 'User'}, {'comment_id': 1259542215, 'comment_body': 'Untitled pageName was causing an UnHandledPromiseRejection in Server which i had fixed later, but as we are making changes i did fix this here. ', 'comment_created': datetime.datetime(2023, 7, 11, 10, 31, 27, tzinfo=datetime.timezone.utc), 'commenter': 'Nabhag8848', 'type': 'User'}, {'comment_id': 1259544411, 'comment_body': 'Made the sub command param to `db` which was discussed previously.', 'comment_created': datetime.datetime(2023, 7, 11, 10, 33, 40, tzinfo=datetime.timezone.utc), 'commenter': 'Nabhag8848', 'type': 'User'}, {'comment_id': 1259595630, 'comment_body': 'Fixed Variable Naming', 'comment_created': datetime.datetime(2023, 7, 11, 11, 24, 39, tzinfo=datetime.timezone.utc), 'commenter': 'Nabhag8848', 'type': 'User'}, {'comment_id': 1259596393, 'comment_body': 'yep, done with this one. ', 'comment_created': datetime.datetime(2023, 7, 11, 11, 25, 26, tzinfo=datetime.timezone.utc), 'commenter': 'Nabhag8848', 'type': 'User'}]
